import itertools
import math

def permutations_with_rotations(iterable):
    pool = tuple(iterable)
    n = len(pool)
    if n == 1:
        return itertools.permutations(pool, n)
    cycles = [range(n)]
    yield itertools.permutations(pool, n)
    while cycles:
        for i, c in enumerate(cycles):
            if c is not cycles[-1]:
                break
        else:
            return
        first = cycles[i]
        rest = cycles[:i] + cycles[i+1:]
        if first is rest[0]:
            cycles = rest
            continue
        newcycles = []
        for c in rest:
            k = len(first)
            if c is first:
                newcycles.extend(itertools.combinations(c, k))
            elif c is first[1:]:
                newcycles.extend(itertools.combinations(c, k-1))
                newcycles.extend(itertools.combinations(c, k))
            else:
                newcycles.append(c)
        cycles = newcycles
        yield itertools.permutations(pool, n)

def seating_arrangements(n_people, n_seats):
    n_arrangements = 1
    for people in range(1, n_people + 1):
        n_arrangements *= n_seats - people + 1
    return n_arrangements

def seating_arrangements_with_rotations(n_people, n_seats):
    n_arrangements = 1
    for people in range(1, n_people + 1):
        n_arrangements *= n_seats - people + 1
        n_arrangements *= math.factorial(people - 1)
    return n_arrangements

