def is_neither_square_nor_cube(n):
    for i in range(1, int(n ** 0.5) + 1):
        if i ** 2 == n:
            return False
    for i in range(1, int(n ** (1 / 3)) + 1):
        if i ** 3 == n:
            return False
    return True


def sequence(n):
    count = 1
    while count < n:
        if is_neither_square_nor_cube(count):
            count += 1
        else:
            count += 1
    return count


