from math import factorial

def place_pieces(pieces, board):
    if pieces == 0:
        return 1
    else:
        count = 0
        for i in range(board[0] - pieces + 1):
            for j in range(board[1] - pieces + 1):
                count += place_pieces(pieces - 1, (board[0] - i - pieces + 1, board[1] - j - pieces + 1))
        return count

def L_shaped_pieces(board):
    return place_pieces(6, board)

print(L_shaped_pieces((3, 6)))

