def divisible_by_6(product):
    return product % 6 == 0

def probability_product_of_visible_faces_divisible_by_6(number_of_visible_faces):
    return factorial(5) / factorial(5 - number_of_visible_faces)

def number_of_visible_faces_that_make_product_divisible_by_6(product):
    for number_of_visible_faces in range(1, 6):
        if divisible_by_6(product / 6**(5 - number_of_visible_faces)):
            return number_of_visible_faces
    return 0

