import math

def is_triangle(a, b, c):
    return (a**2 + b**2) >= c**2 and (a**2 + c**2) >= b**2 and (b**2 + c**2) >= a**2

def is_hexagon(a, b, c):
    return (a**2 + b**2) == c**2 and (a**2 + c**2) == b**2 and (b**2 + c**2) == a**2

def is_triangle_of_hexagon(a, b, c):
    return is_triangle(a, b, c) and is_hexagon(a, b, c)

def triangle_of_hexagon(a, b, c):
    if is_triangle_of_hexagon(a, b, c):
        return True
    else:
        return False

def triangle_of_hexagon_count(n):
    count = 0
    for a in range(1, n):
        for b in range(1, n):
            for c in range(1, n):
                if triangle_of_hexagon(a, b, c):
                    count += 1
    return count

print(triangle_of_hexagon_count(75))

